import logo from './logo.svg';
import './App.css';
import MainPage from './MainPage/MainPage';
import TopMain from './Top/TopMain';
import Body from './Body/Body';
import LoginBox2 from './Body/LoginBox2';
import Enter from './Body/Enter';
import Education from './Body/Education';
import Profile from './Body/Profile';
import MathTest from './Body/SubjectPages/MathTest';
import MathStudy from './Body/SubjectPages/MathStudy';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';
function App() {
  return (
    <Router>
        <Route exact path="/" component={MainPage} />
        <Route path="/" component={TopMain} />
        <Route path="/" component={Body} />
        <Route path="/login" component={LoginBox2} />
        <Route path="/enter" component={Enter} />
        <Route path="/enter" component={Profile} />
        <Route path="/enter/test/math" component={MathTest} />
        <Route path="/enter/strudy/math" component={MathStudy} />
    </Router>
  );
}

export default App;
